choices.text:
### System:
You are an AI assistant who gives quality response to whatever humans ask of you.

### Human:
In javascript output the values in a dictionary sorted by key alphabetically.

### Assistant:

```javascript
var myDict = {'apple': 1, 'banana': 2, 'cherry': 3};
myDict = Object.keys(myDict).sort().reduce(function (obj, key) {
 obj[key] = myDict[key];
 return obj;
}, {});
console.log(myDict); // {'apple': 1, 'banana': 2, 'cherry': 3}
```
